css:
.editor-colors {
  background-color: #272822;
  color: #d9d9d9;
}
.editor {
  background-color: #272822;
  color: #d9d9d9;
}
.editor .wrap-guide {
  background-color: #3a3b36;
}
.editor .indent-guide {
  color: #3a3b36;
}
.editor .invisible-character {
  color: #3a3b36;
}
.editor .gutter {
  background-color: #272822;
  color: #80807d;
}
.editor .gutter .line-number.cursor-line {
  background-color: #3e3d32;
  color: #80807d;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #80807d;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #80807d;
}
.editor .invisible {
  color: #d9d9d9;
}
.editor .cursor {
  color: #f1f2f3;
}
.editor .cursor-line {
  background-color: #3e3d32;
}
.editor .selection .region {
  background-color: #3e3d32;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #acaca9;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffe792;
}
.comment {
  color: #75715e;
}
.entity.name.type {
  color: #6cc7d9;
}
.entity.other.inherited-class {
  color: #ccc47a;
}
.keyword {
  color: #e52d71;
}
.keyword.control {
  color: #e52d71;
}
.keyword.operator {
  color: #e52d71;
}
.keyword.other.special-method {
  color: #9ccc3e;
}
.keyword.other.unit {
  color: #a082d9;
}
.storage {
  color: #6cc7d9;
}
.constant {
  color: #a082d9;
}
.constant.character.escape {
  color: #a082d9;
}
.constant.numeric {
  color: #a082d9;
}
.constant.other.color {
  color: #a082d9;
}
.constant.other.symbol {
  color: #9ccc3e;
}
.variable {
  color: #d9d9d9;
}
.variable.interpolation {
  color: #c61959;
}
.variable.parameter.function {
  color: #d9d9d9;
}
.invalid.illegal {
  background-color: #e52d71;
  color: #d9d9d9;
}
.string {
  color: #ccc47a;
}
.string.regexp {
  color: #ccc47a;
}
.string.regexp .source.ruby.embedded {
  color: #d9882a;
}
.string.other.link {
  color: #e52d71;
}
.punctuation.definition.comment {
  color: #75715e;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #ccc47a;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #6cc7d9;
}
.punctuation.definition.bold {
  color: #ccc47a;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #a082d9;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #c61959;
}
.support.class {
  color: #6cc7d9;
}
.support.function {
  color: #9ccc3e;
}
.support.function.any-method {
  color: #9ccc3e;
}
.entity.name.function {
  color: #9ccc3e;
}
.entity.name.class,
.entity.name.type.class {
  color: #d9d9d9;
}
.entity.name.section {
  color: #6cc7d9;
}
.entity.name.tag {
  color: #e52d71;
}
.entity.other.attribute-name {
  color: #9ccc3e;
}
.entity.other.attribute-name.id {
  color: #9ccc3e;
}
.meta.class {
  color: #d9d9d9;
}
.meta.link {
  color: #d9882a;
}
.meta.require {
  color: #6cc7d9;
}
.meta.selector {
  color: #6cc7d9;
}
.meta.separator {
  background-color: #3e3d32;
  color: #d9d9d9;
}
.none {
  color: #d9d9d9;
}
.markup.bold {
  color: #e52d71;
  font-style: bold;
}
.markup.changed {
  color: #a082d9;
}
.markup.deleted {
  color: #e52d71;
}
.markup.italic {
  color: #6cc7d9;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #6cc7d9;
}
.markup.inserted {
  color: #9ccc3e;
}
.markup.list {
  color: #e52d71;
}
.markup.quote {
  color: #d9882a;
}
.markup.raw.inline {
  color: #9ccc3e;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #d9882a;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
